import { ReactDOM } from 'react';
import classes from './Modal.module.css';

const Modal = (props) => {
    ReactDOM.createPortal()
    console.log(props);
    return (
        <>
            <div className={`${classes.modal} ${props.classes}`}>{props.children}</div>
            <div className={classes.backdrop}></div>
        </>
    );
};

export default Modal;
